import {Card} from 'react-bootstrap'
const Login = () => {
    return ( 
        <Card style={{"margin":"auto","margin-top":"20px","margin-bottom":"20px","width":"500px","padding":"20px"}}>
            <img alt='logo' src={process.env.PUBLIC_URL+"DP.png"}/>
        </Card>
     );
}
 
export default Login;
